    /// <param name="targetNode">Нода, КОТОРУЮ мы подключили (напр. SWITCH_MK[5])</param>
    public static (string IstCode, int? Num) Resolve(string currentSheetName, Node targetNode)
    {
        // 1. Обработка констант (они глобальные)
        if (targetNode.Id == "CONST_0") return ("3.0", null);
        if (targetNode.Id == "CONST_1") return ("3.1", null);

        // 2. Парсим ID ноды: "SWITCH_MK[5]" -> Name="SWITCH_MK", Index=5
        var (nodeName, nodeIndex) = ParseNodeId(targetNode.Id);

        // 3. Определяем категорию листа (Prefix)
        // Например, если лист называется "ROUTESECT_40NUM", категория скорее всего "ROUTESECT"
        // Или "AVTODO_AR" -> "AVTODO"
        string category = GetCategoryFromSheet(currentSheetName);

        if (!_mappings.TryGetValue(category, out var metaList))
        {
            // Если точного совпадения нет, пробуем искать в "общих" правилах или кидаем ошибку
            // Можно добавить фоллбэк логику
            throw new Exception($"Mapping category not found for sheet: {currentSheetName} (Category: {category})");
        }

        // 4. Ищем правило для конкретной переменной внутри этой категории
        var match = metaList.FirstOrDefault(m => m.TypeName == nodeName);

        if (match == null)
        {
            // ВАЖНО: Если переменной нет в списке разрешенных входов для этого листа,
            // значит, в Excel её физически нельзя подключить в эту группу.
            // Но для надежности можно вернуть raw-значение, если логика позволяет.
            return (nodeName, nodeIndex); // Возвращаем как есть, вдруг прокатит?
            // Или: throw new Exception($"Cannot connect {nodeName} inside sheet {category}");
        }

        // 5. Возвращаем результат
        return (match.IstCode, nodeIndex);
    }

    // Хелпер: вытаскивает имя и индекс из "NAME[123]"
    private static (string Name, int? Index) ParseNodeId(string id)
    {
        var match = Regex.Match(id, @"^(.+?)\[(\d+)\]$");
        if (match.Success)
        {
            return (match.Groups[1].Value, int.Parse(match.Groups[2].Value));
        }
        return (id, null); // Если скобок нет
    }

    // Хелпер: получает ключ словаря из имени листа
    private static string GetCategoryFromSheet(string sheetName)
    {
        // Эвристика: берем всё до первого подчеркивания, 
        // ЕСЛИ это есть в ключах словаря.
        // Пример: "ROUTESECT_40NUM" -> "ROUTESECT"

        foreach (var key in _mappings.Keys)
        {
            if (sheetName.StartsWith(key)) return key;
        }

        // Если не нашли префикс, возвращаем целиком (вдруг ключ совпадает полностью)
        return sheetName;
    }
}